AverageAHTOverTime_SAQL.query:
q = load "${App.Datasets.Case_tp.FullyQualifiedName}";
q = filter q by {{column(Dimension1Query.selection, ["Case.DIMENSION1_PLACEHOLDER"]).asEquality("DIMENSION1_PLACEHOLDER")}};
q = filter q by {{column(Dimension2Query.selection, ["Case.DIMENSION2_PLACEHOLDER"]).asEquality("DIMENSION2_PLACEHOLDER")}};
q = filter q by {{column(Dimension3Query.selection, ["Case.DIMENSION3_PLACEHOLDER"]).asEquality("DIMENSION3_PLACEHOLDER")}};
q = filter q by {{column(Dimension4Query.selection, ["Case.DIMENSION4_PLACEHOLDER"]).asEquality("DIMENSION4_PLACEHOLDER")}};
q = filter q by {{row(Case_CreatedDate_1.selection,[0], ["min", "max"]).asDateRange("date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day')")}};
q1 = filter q by 'IsClosed' matches "true" && 'CaseOutcome' in ["AT Correct","Top3", "Inaccurate"];
q1 = group q1 by {{cell(TimeGroupingAHT.selection, 0, "SAQLOverTimeGroupingByCaseOutcome").asGrouping()}};
q1 = foreach q1 generate 
'{{cell(TimeGroupingAHT.selection, 0, "DateDimensionName").asObject()}}' as '{{cell(TimeGroupingAHT.selection, 0, "DateDimensionNameAs").asObject()}}', 'CaseOutcome' as 'CaseOutcome', 
median('CaseHandlingTimeMinutes') as 'CaseHandlingTimeMinutes';

q2 = filter q by 'IsClosed' matches "true";
q2 = group q2 by {{cell(TimeGroupingAHT.selection, 0, "SAQLOverTimeGrouping").asGrouping()}};
q2 = foreach q2 generate 
'{{cell(TimeGroupingAHT.selection, 0, "DateDimensionName").asObject()}}' as '{{cell(TimeGroupingAHT.selection, 0, "DateDimensionNameAs").asObject()}}',
"Overall" as 'CaseOutcome', 
median('CaseHandlingTimeMinutes') as 'CaseHandlingTimeMinutes';

result = union q1,q2;
result = group result by {{cell(TimeGroupingAHT.selection, 0, "SAQLOverTimeGroupingByDateAndCaseOutcome").asGrouping()}};

result = foreach result generate 
'{{cell(TimeGroupingAHT.selection, 0, "DateDimensionNameAs").asObject()}}', 'CaseOutcome', median('CaseHandlingTimeMinutes') as 'Handling Time (Minutes)';
result = order result by ('{{cell(TimeGroupingAHT.selection, 0, "DateDimensionNameAs").asObject()}}' asc, 'CaseOutcome' asc);

