CreatedDate_Year_Cre_1.query:
q = load "${App.Datasets.Case_tp.FullyQualifiedName}";
q = filter q by {{row(Case_CreatedDate_1.selection,[0], ["min", "max"]).asDateRange("date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day')")}};
q = filter q by 'IsClosed' == "true";
q = filter q by {{column(Dimension1Query.selection, ["Case.DIMENSION1_PLACEHOLDER"]).asEquality("DIMENSION1_PLACEHOLDER")}};
q = filter q by {{column(Dimension2Query.selection, ["Case.DIMENSION2_PLACEHOLDER"]).asEquality("DIMENSION2_PLACEHOLDER")}};
q = filter q by {{column(Dimension3Query.selection, ["Case.DIMENSION3_PLACEHOLDER"]).asEquality("DIMENSION3_PLACEHOLDER")}};
