result = foreach result generate coalesce(q_A['{{cell(TimeGrouping_1.selection, 0, "DateDimensionName").asObject()}}'], q_B['{{cell(TimeGrouping_1.selection, 0, "DateDimensionName").asObject()}}']) as '{{cell(TimeGrouping_1.selection, 0, "DateDimensionNameAs").asObject()}}', coalesce(q_A['RI.RIOutcome'], q_B['RI.RIOutcome']) as 'RI.RIOutcome', count(q_B) as 'B';
