result = filter result by {{column(RIOutcome_1.result, ["RIOutcome"]).asEquality("RI.RIOutcome")}};
result = order result by ('{{cell(TimeGrouping_1.selection, 0, "DateDimensionNameAs").asObject()}}' asc, 'RI.RIOutcome' asc);
